const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">


    <p>{`In the Swift programming language, nearly everything is based on a named type or compound type. Named types can be assigned names when created. These include `}<em parentName="p">{`classes`}</em>{`, `}<em parentName="p">{`structures`}</em>{`, `}<em parentName="p">{`enumerations`}</em>{`, and `}<em parentName="p">{`protocols`}</em>{`. Instances of user-defined named types carry the name of the given type. For example, a class named `}<inlineCode parentName="p">{`MyClass`}</inlineCode>{` will have the type `}<inlineCode parentName="p">{`MyClass`}</inlineCode>{`. Swift also includes many standard named types for arrays, dictionaries and optional values.`}</p>
    </MDXLayout>;
}

